import React, { Component } from 'react'

export class ListHeading extends Component {

    state = {
        todoList: this.props.todoList
    }

    updateListAndGoHome() {
        this.props.updateListChanges(this.state.todoList);
        this.props.goHome();
    }
    render() {
        return (
            <div id="list_heading"
                onClick={this.updateListAndGoHome}
            >   @todo
            </div>
        )
    }
}

export default ListHeading
